1.其实主要是赶作业自用的(
2.有部分参考其它歌单的√

歌单适用环境：肝作业，睡前，夜晚散步。
其实曲目还是比较杂的..

以此歌单，纪念神主39岁生日。2016.3.18

东方一曲黄梁梦，众神眷恋幻想乡；
红魔地灵夜神雪，永夜风神星莲船;
绯想天则文花帖，萃梦神灵绯想天；
冥界地狱异变起，樱下华胥主谋现;
净罪无改渡黄泉，华鸟风月是非辨;
境界颠覆入迷途，幻想花开啸风弄;
二色花蝶双生缘，前缘未尽今生还;
星屑洒落雨霖铃，虹彩慧光银尘耀;
无寿迷蝶彼岸归，幻真如画妖如月;
永劫夜宵哀伤起，幼社灵中幻似梦;
追忆往昔巫女缘，须弥之间冥梦现;
仁榀华诞井中天，歌雅风颂心无念;

东方Project(日文:东方Project(とうほうプロジェクト，东方プロジェクト)，英文:Tōhō Project或TouHou Project，简称东方)是日本同人游戏社团上海爱丽丝幻乐团所制作的一系列同人游戏、相关作品以及其二次创作所构成的覆盖游戏、动画、漫画、音乐、文学等诸多方面的领域。
